  HARVEY WILLIAMS, Simon Philip and SAMUEL, Angela Mary (cont...)
  India and the Himalayas helped to enliven an abiding passion for travel. His other interests
  include art, architecture, history, photography, music, films and theatre.
  Angela was educated at Aldershot County High School for Girls and The University of Sheffield,
  where she graduated with an Honours degree in Ancient History. Before starting a family, Angela
  lived in London for ten years and worked in public relations in the professional theatre. She was
  also an active member of a number of amateur dramatics groups, so theatre formed a major part of
  her life. To enable her to bring up their two children, Angela took a career break, and also
  helped Simon with the financial administration of their business partnership. Recently she has
  started a teacher training course with The Open University, with the intention of becoming a
  secondary school history teacher. Angela's interests include walking, swimming, reading, travel,
  history and heritage. She lived in France for a year and speaks French well.
  01> HARVEY WILLIAMS, Anna Mary
  b 06.02.1989
  Anna goes to school at Queen Eleanor's Junior School in Guildford. She likes school and her
  favourite subject is art. She particularly enjoys model-making. She plays her recorder in
  assembly each day, and is a talented violinist; she has recently been asked to take part in the
  BBC TV programme "Songs of Praise" with a group of pupils from her school. Anna also enjoys
  swimming, reading, drama and dance.
  02> HARVEY WILLIAMS, Frederick Amadeus
  b 16.07.1991
  Freddie goes to St Nicolas C.E. Primary School in Guildford. He is very keen on football, and
  plays both at school and with other friends in the local community. He plays the recorder well
  and is eager to play the saxophone, His favourite subject is art, and he draws beautifully!
  Riding his bicycle, swimming and making things are other interests of his.
  02> WILLIAMS, Richard John Harvey m on 30.08.1986 to BALL, Marion Helena
  b 04.09.1958
  b 06.01.1956
  Richard b. at Walton-on-Thames and m. at the parish church in Hedsor, Bucks. Marion, d/o James
  Sidney Ball and Helena Ann Winnecki. Address: September Cottage, Old Vicarage Way, Woodburn Town,
  High Wycombe, Bucks HP10 0QS, England.
  Richard was educated at Rugby School and Edinburgh University. He gained Second Class Honours in
  Engineering Science at Edinburgh and won the R B Campbell Memorial Prize for physical education. He
  was Vice-President of the Sports Union and (after his great grandfather) renewed the family links
  with the Edinburgh University Cycling Club where he served as President for two years. He took a
  post as instructor at Strathcona Park Outdoor Centre on Vancouver Island and spent a sabbatical
  year in Canada before returning to engineering. He worked for GEC Turbine Generators in Rugby for
  five years, specialising in quality control and becoming Chief Inspector of the High Pressure
  Turbine Division. More recently he has been working for Mars Confectionery in Slough, applying
  quality assurance techniques to the field of health and safety management and to manufacturing
  management in general.
